// Helper function to get relevant skills for a team
const getRelevantSkills = (team: string): string[] => {
  const teamSkillMap: Record<string, string[]> = {
    'Engineering': ['js', 'ts', 'react', 'node', 'python', 'java', 'aws', 'docker', 'k8s', 'ci-cd'],
    'Design': ['ui-design', 'ux-design', 'figma', 'sketch', 'adobe-xd', 'prototyping', 'user-research', 'design-systems'],
    'Product': ['product-strategy', 'roadmapping', 'user-stories', 'agile', 'scrum', 'data-analysis', 'market-research', 'stakeholder-mgmt'],
    'Marketing': ['digital-marketing', 'content-strategy', 'seo', 'social-media', 'analytics', 'email-marketing', 'brand-strategy', 'marketing-automation'],
    'Sales': ['sales-strategy', 'negotiation', 'account-mgmt', 'crm', 'lead-gen', 'sales-ops', 'forecasting', 'presentations'],
    'Finance': ['financial-analysis', 'budgeting', 'forecasting-fin', 'reporting', 'accounting', 'risk-mgmt', 'compliance', 'audit'],
    'HR': ['talent-mgmt', 'compensation', 'hr-ops', 'employee-relations', 'training', 'hr-analytics', 'dei', 'hr-compliance'],
    'Management': ['team-leadership', 'project-mgmt', 'mentoring', 'recruiting', 'performance-mgmt', 'budget-mgmt', 'strategy', 'operations']
  };

  return teamSkillMap[team] || [];
};

type ViewMode = 'skills' | 'teams';

const SkillsMatrix: React.FC = () => {
  const theme = useTheme();
  const { users } = useUsers();
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState<string>('');
  const [selectedTeams, setSelectedTeams] = useState<string[]>([]);
  const [viewMode, setViewMode] = useState<ViewMode>('skills');

  // Get unique categories from skills
  const categories = useMemo(() => {
    return Array.from(new Set(sampleSkills.map(skill => skill.category)));
  }, []);

  // Get unique teams from users
  const teams = useMemo(() => {
    return Array.from(new Set(users.map(user => user.team)));
  }, [users]);

  // Filter skills based on search, category, and team relevance
  const filteredSkills = useMemo(() => {
    let skills = sampleSkills;

    // Filter by search term
    if (searchTerm) {
      skills = skills.filter(skill => 
        skill.name.toLowerCase().includes(searchTerm.toLowerCase())
      );
    }

    // Filter by category
    if (selectedCategory) {
      skills = skills.filter(skill => skill.category === selectedCategory);
    }

    // Filter by team relevance in teams view
    if (viewMode === 'teams' && selectedTeams.length > 0) {
      const relevantSkillIds = new Set(
        selectedTeams.flatMap(team => getRelevantSkills(team))
      );
      skills = skills.filter(skill => relevantSkillIds.has(skill.id));
    }

    return skills;
  }, [searchTerm, selectedCategory, selectedTeams, viewMode]);

  // Filter users based on search and selected teams
  const filteredUsers = useMemo(() => {
    return users.filter(user => {
      const matchesSearch = user.name.toLowerCase().includes(searchTerm.toLowerCase());
      const matchesTeam = selectedTeams.length === 0 || selectedTeams.includes(user.team);
      return matchesSearch && matchesTeam;
    });
  }, [users, searchTerm, selectedTeams]);

  const getSkillLevel = (user: User, skillId: string): number => {
    return user.skills?.find(s => s.skillId === skillId)?.level || 0;
  };

  const handleTeamToggle = (team: string) => {
    setSelectedTeams(prev => {
      if (prev.includes(team)) {
        return prev.filter(t => t !== team);
      } else {
        return [...prev, team];
      }
    });
  };

  const clearFilters = () => {
    setSearchTerm('');
    setSelectedCategory('');
    setSelectedTeams([]);
  };

  return (
    <Box sx={{ p: 3 }}>
      <Box sx={{ mb: 3, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <Typography variant="h4">Skills Matrix</Typography>
        <ToggleButtonGroup
          value={viewMode}
          exclusive
          onChange={(e, newMode) => newMode && setViewMode(newMode)}
          size="small"
        >
          <ToggleButton value="skills">
            <SkillIcon sx={{ mr: 1 }} />
            By Skills
          </ToggleButton>
          <ToggleButton value="teams">
            <GroupIcon sx={{ mr: 1 }} />
            By Teams
          </ToggleButton>
        </ToggleButtonGroup>
      </Box>

      {/* Filters */}
      <Paper variant="outlined" sx={{ p: 2, mb: 3 }}>
        <Stack spacing={2}>
          <Box sx={{ display: 'flex', gap: 2, alignItems: 'center' }}>
            <TextField
              placeholder={viewMode === 'skills' ? "Search skills or users..." : "Search team members..."}
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              sx={{ width: 300 }}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <SearchIcon />
                  </InputAdornment>
                ),
              }}
            />

            {viewMode === 'skills' && (
              <FormControl sx={{ minWidth: 200 }}>
                <InputLabel>Category</InputLabel>
                <Select
                  value={selectedCategory}
                  onChange={(e) => setSelectedCategory(e.target.value)}
                  label="Category"
                >
                  <MenuItem value="">All Categories</MenuItem>
                  {categories.map(category => (
                    <MenuItem key={category} value={category}>{category}</MenuItem>
                  ))}
                </Select>
              </FormControl>
            )}

            {(searchTerm || selectedCategory || selectedTeams.length > 0) && (
              <Button
                startIcon={<ClearIcon />}
                onClick={clearFilters}
                size="small"
                sx={{ ml: 'auto' }}
              >
                Clear Filters
              </Button>
            )}
          </Box>

          {viewMode === 'teams' && (
            <Box sx={{ display: 'flex', gap: 1, flexWrap: 'wrap' }}>
              {teams.map(team => (
                <Chip
                  key={team}
                  label={team}
                  onClick={() => handleTeamToggle(team)}
                  color={selectedTeams.includes(team) ? 'primary' : 'default'}
                  variant={selectedTeams.includes(team) ? 'filled' : 'outlined'}
                />
              ))}
            </Box>
          )}
        </Stack>
      </Paper>

      {/* Matrix Table */}
      <TableContainer component={Paper} variant="outlined">
        <Table sx={{ minWidth: 650 }} size="small">
          <TableHead>
            <TableRow>
              <TableCell 
                sx={{ 
                  bgcolor: theme.palette.background.default,
                  position: 'sticky',
                  left: 0,
                  zIndex: 2,
                  minWidth: 200
                }}
              >
                {viewMode === 'skills' ? 'User / Skill' : 'Team Member'}
              </TableCell>
              {viewMode === 'skills' ? (
                // Skills view columns
                filteredSkills.map(skill => (
                  <TableCell 
                    key={skill.id}
                    align="center"
                    sx={{ 
                      minWidth: 120,
                      bgcolor: theme.palette.background.default
                    }}
                  >
                    <Tooltip title={`Category: ${skill.category}`} arrow>
                      <Typography variant="subtitle2" sx={{ whiteSpace: 'nowrap' }}>
                        {skill.name}
                      </Typography>
                    </Tooltip>
                  </TableCell>
                ))
              ) : (
                // Teams view columns
                sampleSkills.map(skill => (
                  <TableCell 
                    key={skill.id}
                    align="center"
                    sx={{ 
                      minWidth: 120,
                      bgcolor: theme.palette.background.default
                    }}
                  >
                    <Tooltip title={`Category: ${skill.category}`} arrow>
                      <Typography variant="subtitle2" sx={{ whiteSpace: 'nowrap' }}>
                        {skill.name}
                      </Typography>
                    </Tooltip>
                  </TableCell>
                ))
              )}
            </TableRow>
          </TableHead>
          <TableBody>
            {filteredUsers.map(user => (
              <TableRow key={user.id}>
                <TableCell 
                  component="th" 
                  scope="row"
                  sx={{ 
                    bgcolor: theme.palette.background.paper,
                    position: 'sticky',
                    left: 0,
                    zIndex: 1
                  }}
                >
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                    <Typography>{user.name}</Typography>
                    <Chip 
                      label={user.team} 
                      size="small" 
                      sx={{ 
                        bgcolor: alpha(theme.palette.primary.main, 0.1),
                        color: theme.palette.primary.main
                      }}
                    />
                  </Box>
                </TableCell>
                {(viewMode === 'skills' ? filteredSkills : sampleSkills).map(skill => (
                  <TableCell key={skill.id} align="center">
                    <Tooltip 
                      title={getSkillLevel(user, skill.id) > 0 ? 
                        `Experience: ${user.skills?.find(s => s.skillId === skill.id)?.yearsOfExperience} years` : 
                        'No experience'
                      } 
                      arrow
                    >
                      <Box>
                        <Rating
                          value={getSkillLevel(user, skill.id)}
                          readOnly
                          max={5}
                          size="small"
                        />
                      </Box>
                    </Tooltip>
                  </TableCell>
                ))}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default SkillsMatrix;
